import React, { useEffect, useRef } from "react"

const { tableau } = window;

function Dashboard1() {
    const ref = useRef(null);
    const url = "https://public.tableau.com/views/Tableau_FCQ/Final_1?:language=en&:display_count=y&:origin=viz_share_link";

    function initViz() {
        new tableau.Viz(ref.current, url);
    }

    useEffect( () => {
        initViz();
    }, [])

    return(
        <div>
            <h1>Dashboard 1 </h1>
            <div ref = {ref}></div>
        </div>
    )
}

export default Dashboard1;
